INSERT INTO `tiki_pages` VALUES (1,'HomePage','HomePage',0,'!Congratulations\nThis is the default homepage for your Tiki. If you are seeing this page, your installation was successful.\n\nYou can change this page after logging in. Please review the [http://doc.tiki.org/wiki+syntax|wiki syntax] for editing details.\n\n\n!!Get started.\nTo begin configuring your site:\n{FANCYLIST()}\n1) Log in with your newly created password.\n2) Manually [tiki-admin.php?page=features|Enable specific Tiki features] that you didn\'t enable with the Admin wizard.\n3) Run [tiki-admin.php?page=profiles|Tiki Profiles] to quickly get up and running.\n{FANCYLIST}\n\n!!Need help?\nFor more information:\n*[https://tiki.org/Introduction|Learn more about Tiki].\n*[https://tiki.org/|Get help], including the [http://doc.tiki.org|official documentation] and [http://tiki.org/forums|support forums].\n*[https://tiki.org/Join|Join the Tiki community].\n','',1581291814,'Tiki initialization',1,0,'admin','0.0.0.0','',NULL,NULL,NULL,NULL,NULL,NULL,'admin',851,'en','',0,1581291814,'n','',NULL,NULL);
